import React, { useEffect } from "react";
import { MDCFloatingLabel } from "@material/floating-label";
// const floatingLabel = new MDCFloatingLabel(
//   document.querySelector(".mdc-floating-label")
// );

const test = () => {
  const labelFloat = () => {
    if ($(this).value == "") {
      $(this).addClass("filled");
    } else {
      $(this).removeClass("filled");
    }

    return (
      <div className="flex flex-col">
        <button className="btn btnRed">Rouge</button>
        <button className="btn btnBlue">Bleu</button>
        <button className="btn btnGreen">Vert</button>

        <form>
          <label>Nom</label>
          <input className="inputText" onClick={labelFloat} type="text"></input>
          <div class="textinput">
            <input type="text" id="name" />
            <label for="name">First name</label>
          </div>
        </form>
        <div className="mdc-text-field">
          <input
            className="mdc-text-field__input"
            onClick={labelFloat}
            id="text-field-hero-input"
          />
          <div className="mdc-line-ripple"></div>
          <label for="text-field-hero-input" className="mdc-floating-label">
            Test1234
          </label>
        </div>
      </div>
    );
  };
};

export default test;
